import { PlusOutlined } from '@ant-design/icons';
import {
  ActionType,
  ModalForm,
  PageContainer,
  ProFormCheckbox,
  ProFormSelect,
  ProFormText,
  ProTable,
} from '@ant-design/pro-components';
import { Button, Form, message, Popconfirm } from 'antd';
import React, { useMemo, useRef, useState } from 'react';

import type { Account, AccountType, CreateAccountReq, PatchAccountReq } from '@/services/accounts';
import { createAccount, listAccounts, patchAccount, deleteAccount } from '@/services/accounts';
import type { Institution } from '@/services/institutions';
import { createInstitution, listInstitutions } from '@/services/institutions';

import styles from './index.less';

type AccountFormValues = {
  name: string;
  institution_id?: number | null;
  type: AccountType;
  currency?: string;
  is_liquid?: boolean;
};

type InstitutionFormValues = {
  name: string;
};

export const accountTypeEnum: Record<AccountType, { text: string }> = {
  cash: { text: '' },
  debit: { text: '' },
  credit: { text: '' },
  investment_cash: { text: '' },
  other: { text: '' },
};

const Accounts: React.FC = () => {
  const actionRef = useRef<ActionType>();
  const [institutions, setInstitutions] = useState<Institution[]>([]);
  const [createOpen, setCreateOpen] = useState(false);
  const [editOpen, setEditOpen] = useState(false);
  const [institutionCreateOpen, setInstitutionCreateOpen] = useState(false);
  const [editing, setEditing] = useState<Account | undefined>(undefined);
  const [accountForm] = Form.useForm<AccountFormValues>();
  const [institutionForm] = Form.useForm<InstitutionFormValues>();

  const institutionNameById = useMemo(() => {
    const map = new Map<number, string>();
    institutions.forEach((i) => map.set(i.id, i.name));
    return map;
  }, [institutions]);

  const loadInstitutions = async () => {
    try {
      const resp = await listInstitutions();
      setInstitutions(resp.items);
    } catch (e) {
      message.error('');
      setInstitutions([]);
    }
  };



  return (
    <PageContainer
      header={{
        title: '',
      }}
      extra={[
        <Button
          key="create"
          type="primary"
          icon={<PlusOutlined />}
          onClick={async () => {
            await loadInstitutions();
            accountForm.resetFields();
            setCreateOpen(true);
          }}
        >

        </Button>,
      ]}
    >
      <div className={styles.toolbar} />
      <ProTable<Account>
        actionRef={actionRef}
        rowKey="id"
        search={false}
        request={async () => {
          await loadInstitutions();
          const resp = await listAccounts();
          return {
            data: resp.items,
            success: true,
          };
        }}
        columns={[
          {
            title: '',
            valueType: 'index',
            width: 48,
          },
          {
            title: '',
            dataIndex: 'name',
          },
          {
            title: '',
            dataIndex: 'type',
            valueEnum: accountTypeEnum,
            width: 120,
          },
          {
            title: '',
            dataIndex: 'institution_id',
            width: 180,
            render: (_, record) => {
              if (!record.institution_id) return '-';
              return institutionNameById.get(record.institution_id) || String(record.institution_id);
            },
          },
          {
            title: '',
            dataIndex: 'is_liquid',
            width: 120,
            align: 'center',
            render: (_, record) => (record.is_liquid ? '' : ''),
          },
          {
            title: '',
            dataIndex: 'latest_balance',
            width: 150,
            align: 'right',
            valueType: 'money',
            render: (dom, record) => {
              return record.latest_balance !== undefined && record.latest_balance !== null 
                ? dom 
                : '-';
            },
          },
          {
            title: '',
            valueType: 'option',
            width: 120,
            render: (_, record) => [
              <a
                key="edit"
                onClick={async () => {
                  await loadInstitutions();
                  setEditing(record);
                  accountForm.setFieldsValue({
                    name: record.name,
                    institution_id: record.institution_id,
                    type: record.type,
                    currency: record.currency,
                    is_liquid: record.is_liquid,
                  });
                  setEditOpen(true);
                }}
              >

              </a>,
              <Popconfirm
                key="delete"
                title=""
                description=""
                onConfirm={async () => {
                  try {
                    await deleteAccount(record.id);
                    message.success('');
                    actionRef.current?.reload();
                  } catch (e) {
                    console.error('Delete failed:', e);
                    message.error('');
                  }
                }}
              >
                <a style={{ color: 'red', marginLeft: 8 }}></a>
              </Popconfirm>,
            ],
          },
        ]}
      />

      <ModalForm<AccountFormValues>
        form={accountForm}
        title=""
        open={createOpen}
        onOpenChange={(v) => setCreateOpen(v)}
        modalProps={{ destroyOnClose: true }}
        onFinish={async (values) => {
          try {
            const payload: CreateAccountReq = {
              name: values.name,
              institution_id: values.institution_id ?? null,
              type: values.type,
              currency: values.currency || 'CNY',
              is_liquid: !!values.is_liquid,
            };
            await createAccount(payload);
            message.success('');
            actionRef.current?.reload();
            return true;
          } catch (e) {
            message.error('');
            return false;
          }
        }}
      >
        <ProFormText name="name" label="" rules={[{ required: true }]} />
        <ProFormSelect
          name="institution_id"
          label=""
          options={institutions.map((i) => ({ label: i.name, value: i.id }))}
          fieldProps={{
            allowClear: true,
            dropdownRender: (menu) => (
              <div>
                {menu}
                <div>
                  <Button
                    type="link"
                    onClick={() => {
                      institutionForm.resetFields();
                      setInstitutionCreateOpen(true);
                    }}
                  >

                  </Button>
                </div>
              </div>
            ),
          }}
        />
        <ProFormSelect
          name="type"
          label=""
          valueEnum={accountTypeEnum}
          rules={[{ required: true }]}
          fieldProps={{
            onChange: (v) => {
              if (v === 'credit') {
                const current = accountForm.getFieldValue('is_liquid');
                if (current === undefined) {
                  accountForm.setFieldsValue({ is_liquid: false });
                }
              }
            },
          }}
        />
        <ProFormText name="currency" label="" initialValue="CNY" />
        <ProFormCheckbox name="is_liquid"></ProFormCheckbox>
      </ModalForm>

      <ModalForm<AccountFormValues>
        form={accountForm}
        title=""
        open={editOpen}
        onOpenChange={(v) => {
          setEditOpen(v);
          if (!v) {
            setEditing(undefined);
          }
        }}
        modalProps={{ destroyOnClose: true }}
        onFinish={async (values) => {
          if (!editing) return false;
          try {
            const payload: PatchAccountReq = {
              name: values.name,
              institution_id: values.institution_id ?? null,
              type: values.type,
              currency: values.currency,
              is_liquid: !!values.is_liquid,
            };
            await patchAccount(editing.id, payload);
            message.success('');
            actionRef.current?.reload();
            return true;
          } catch (e) {
            message.error('');
            return false;
          }
        }}
      >
        <ProFormText name="name" label="" rules={[{ required: true }]} />
        <ProFormSelect
          name="institution_id"
          label=""
          options={institutions.map((i) => ({ label: i.name, value: i.id }))}
          fieldProps={{ allowClear: true }}
        />
        <ProFormSelect
          name="type"
          label=""
          valueEnum={accountTypeEnum}
          rules={[{ required: true }]}
        />
        <ProFormText name="currency" label="" />
        <ProFormCheckbox name="is_liquid"></ProFormCheckbox>
      </ModalForm>

      <ModalForm<InstitutionFormValues>
        form={institutionForm}
        title=""
        open={institutionCreateOpen}
        onOpenChange={(v) => setInstitutionCreateOpen(v)}
        modalProps={{ destroyOnClose: true }}
        onFinish={async (values) => {
          try {
            const created = await createInstitution({ name: values.name });
            message.success('');
            await loadInstitutions();
            accountForm.setFieldsValue({ institution_id: created.id });
            return true;
          } catch (e) {
            message.error('');
            return false;
          }
        }}
      >
        <ProFormText name="name" label="" rules={[{ required: true }]} />
      </ModalForm>
    </PageContainer>
  );
};

export default Accounts;

