import React, { useState, useEffect } from 'react';
import { PageContainer } from '@ant-design/pro-components';
import { EditableProTable } from '@ant-design/pro-components';
import type { ProColumns } from '@ant-design/pro-components';
import { Button, DatePicker, message, Card, Space } from 'antd';
import dayjs from 'dayjs';
import { listAccounts, Account } from '@/services/accounts';
import { batchUpsertSnapshots, listSnapshots, SnapshotItem } from '@/services/snapshots';

type DataSourceType = {
  id: React.Key;
  account_id: number;
  account_name: string;
  institution_name: string;
  type: string;
  balance: number | null;
  latest_balance?: number | null;
  latest_date?: string | null;
};

const SnapshotEntry: React.FC = () => {
  const [date, setDate] = useState<dayjs.Dayjs>(dayjs());
  const [editableKeys, setEditableRowKeys] = useState<React.Key[]>([]);
  const [dataSource, setDataSource] = useState<DataSourceType[]>([]);
  const [loading, setLoading] = useState(false);
  const [reloadKey, setReloadKey] = useState(0);

  // 
  const loadData = async (targetDate: dayjs.Dayjs) => {
    setLoading(true);
    try {
      const dateStr = targetDate.format('YYYY-MM-DD');
      
      // 
      const [accountsResp, snapshotsResp] = await Promise.all([
        listAccounts(),
        listSnapshots(dateStr).catch(() => ({ items: [] } as any)) // 
      ]);

      const accounts = accountsResp.items || [];
      const snapshots = snapshotsResp.items || [];
      const snapshotMap = new Map(snapshots.map((s: any) => [s.account_id, s.balance]));

      // 
      const data: DataSourceType[] = accounts.map((acc: Account) => {
        const bal = snapshotMap.get(acc.id);
        return {
          id: acc.id,
          account_id: acc.id,
          account_name: acc.name,
          institution_name: `Institution ${acc.institution_id}`, // 
          type: acc.type,
          // balance 
          // balance  null
          //  0 
          balance: (bal !== undefined && bal !== null) ? Number(bal) : null,
          latest_balance: acc.latest_balance,
          latest_date: acc.latest_date,
        };
      });

      setDataSource(data);
      setEditableRowKeys(data.map(item => item.id)); // 
      setReloadKey(prev => prev + 1);
    } catch (error) {
      console.error(error);
      message.error('Failed to load data');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    loadData(date);
  }, [date]);

  const handleSave = async () => {
    const rows: SnapshotItem[] = dataSource
      .filter(item => item.balance !== null && item.balance !== undefined) // 
      .map(item => ({
        date: date.format('YYYY-MM-DD'),
        account_id: item.account_id,
        balance: Number(item.balance),
      }));

    if (rows.length === 0) {
      message.warning('No data to save');
      return;
    }

    try {
      const res = await batchUpsertSnapshots({ rows });
      message.success(`Saved successfully: Inserted ${res.inserted}, Updated ${res.updated}`);
      loadData(date);
    } catch (error: any) {
      message.error(error.message || 'Save failed');
    }
  };

  const columns: ProColumns<DataSourceType>[] = [
    {
      title: '',
      dataIndex: 'account_name',
      readonly: true,
      width: '20%',
    },
    {
      title: '',
      dataIndex: 'type',
      readonly: true,
      width: '15%',
      valueEnum: {
        cash: { text: '', status: 'Success' },
        debit: { text: '', status: 'Processing' },
        credit: { text: '', status: 'Error' },
        investment_cash: { text: '', status: 'Warning' },
        other: { text: '', status: 'Default' },
      },
    },
    {
      title: '',
      dataIndex: 'latest_date',
      readonly: true,
      width: '15%',
      valueType: 'date',
      render: (_, record: any) => {
        return record.latest_date ? record.latest_date : '-';
      }
    },
    {
      title: '',
      dataIndex: 'latest_balance',
      readonly: true,
      width: '20%',
      valueType: 'money',
      render: (_, record: any) => {
        // We need to pass latest_balance from API first
        return record.latest_balance !== undefined && record.latest_balance !== null 
          ? record.latest_balance 
          : '-';
      }
    },
    {
      title: '',
      dataIndex: 'balance',
      valueType: 'money',
      width: '30%',
      fieldProps: {
        autoFocus: false,
        placeholder: '',
      }
    },
  ];

  return (
    <PageContainer title="">
      <Card>
        <Space style={{ marginBottom: 16 }}>
          <span></span>
          <DatePicker 
            value={date} 
            onChange={(d) => d && setDate(d)} 
            allowClear={false}
          />
          <Button type="primary" onClick={handleSave} loading={loading}>
            
          </Button>
          <Button onClick={() => loadData(date)}>
            
          </Button>
        </Space>
        
        <EditableProTable<DataSourceType>
          key={reloadKey}
          rowKey="id"
          headerTitle={` (${date.format('YYYY-MM-DD')})`}
          loading={loading}
          columns={columns}
          value={dataSource}
          onChange={(val) => setDataSource([...val])}
          recordCreatorProps={false}
          editable={{
            type: 'multiple',
            editableKeys,
            onChange: setEditableRowKeys,
            onValuesChange: (record, recordList) => {
              setDataSource([...recordList]);
            },
          }}
        />
      </Card>
    </PageContainer>
  );
};

export default SnapshotEntry;

