import { PlusOutlined } from '@ant-design/icons';
import {
  ActionType,
  ModalForm,
  PageContainer,
  ProFormDigit,
  ProFormSelect,
  ProFormText,
  ProFormTextArea,
  ProTable,
} from '@ant-design/pro-components';
import { Button, Form, message, Popconfirm, Radio, Tag } from 'antd';
import React, { useMemo, useRef, useState } from 'react';

import type { Institution } from '@/services/institutions';
import { createInstitution, listInstitutions } from '@/services/institutions';
import type {
  CreateProductReq,
  LiquidityRule,
  PatchProductReq,
  Product,
  ProductType,
  ProductWithMetrics,
} from '@/services/products';
import { createProduct, listProducts, patchProduct, deleteProduct } from '@/services/products';
import { history } from '@umijs/max';

import styles from './index.less';

type ProductFormValues = {
  name: string;
  institution_id?: number | null;
  product_code?: string | null;
  product_type: ProductType;
  risk_level?: string | null;
  term_days?: number | null;
  liquidity_rule: LiquidityRule;
  settle_days?: number;
  note?: string | null;
};

type InstitutionFormValues = {
  name: string;
};

const Products: React.FC = () => {
  const actionRef = useRef<ActionType>();
  const [institutions, setInstitutions] = useState<Institution[]>([]);
  const [createOpen, setCreateOpen] = useState(false);
  const [editOpen, setEditOpen] = useState(false);
  const [institutionCreateOpen, setInstitutionCreateOpen] = useState(false);
  const [editing, setEditing] = useState<Product | undefined>(undefined);
  const [productForm] = Form.useForm<ProductFormValues>();
  const [institutionForm] = Form.useForm<InstitutionFormValues>();
  const [window, setWindow] = useState('8w');

  const institutionNameById = useMemo(() => {
    const map = new Map<number, string>();
    institutions.forEach((i) => map.set(i.id, i.name));
    return map;
  }, [institutions]);

  const loadInstitutions = async () => {
    try {
      const resp = await listInstitutions();
      setInstitutions(resp.items);
    } catch (e) {
      message.error('');
      setInstitutions([]);
    }
  };

  const productTypeEnum: Record<ProductType, { text: string }> = {
    bank_wmp: { text: '' },
    money_market: { text: '/' },
    term_deposit: { text: '' },
    fund: { text: '' },
    stock: { text: '' },
    other: { text: '' },
  };

  const liquidityRuleEnum: Record<LiquidityRule, { text: string }> = {
    open: { text: '' },
    closed: { text: '' },
    periodic_open: { text: '' },
  };

  return (
    <PageContainer
      header={{
        title: '',
      }}
      extra={[
        <Radio.Group
          key="window"
          value={window}
          onChange={(e) => {
            setWindow(e.target.value);
            actionRef.current?.reload();
          }}
          buttonStyle="solid"
        >
          <Radio.Button value="4w">1</Radio.Button>
          <Radio.Button value="8w">2</Radio.Button>
          <Radio.Button value="12w">3</Radio.Button>
          <Radio.Button value="24w"></Radio.Button>
          <Radio.Button value="1y">1</Radio.Button>
        </Radio.Group>,
        <Button
          key="create"
          type="primary"
          icon={<PlusOutlined />}
          onClick={async () => {
            await loadInstitutions();
            productForm.resetFields();
            setCreateOpen(true);
          }}
        >

        </Button>,
      ]}
    >
      <div className={styles.toolbar} />
      <ProTable<ProductWithMetrics>
        actionRef={actionRef}
        rowKey="id"
        search={false}
        request={async () => {
          await loadInstitutions();
          const resp = await listProducts(true, window);
          return {
            data: resp.items,
            success: true,
          };
        }}
        columns={[
          {
            title: '',
            dataIndex: 'name',
            render: (dom, record) => <a onClick={() => history.push(`/products/${record.id}`)}>{dom}</a>,
          },
          {
            title: '',
            dataIndex: 'institution_id',
            render: (_, record) => {
              if (!record.institution_id) return '-';
              return institutionNameById.get(record.institution_id) || String(record.institution_id);
            },
          },
          {
            title: '',
            dataIndex: 'risk_level',
            render: (_, record) => {
              if (!record.risk_level) return '-';
              return <Tag color="blue">{record.risk_level}</Tag>;
            },
          },
          {
            title: '',
            dataIndex: 'term_days',
            render: (_, record) => {
              if (record.term_days === null || record.term_days === undefined) return '-';
              if (record.term_days === 0) return '0';
              return `${record.term_days}`;
            },
          },
          {
            title: '',
            dataIndex: 'liquidity_rule',
            valueEnum: liquidityRuleEnum,
          },
          {
            title: '',
            dataIndex: ['metrics', 'annualized'],
            sorter: (a, b) => (a.metrics?.annualized || -999) - (b.metrics?.annualized || -999),
            render: (_, record) =>
              record.metrics ? (
                `${(record.metrics.annualized * 100).toFixed(2)}%`
              ) : (
                <span style={{ color: '#ccc' }}>--</span>
              ),
          },
          {
            title: '',
            dataIndex: ['metrics', 'max_drawdown'],
            sorter: (a, b) => (a.metrics?.max_drawdown || 999) - (b.metrics?.max_drawdown || 999),
            defaultSortOrder: 'ascend',
            render: (_, record) =>
              record.metrics ? (
                `${(record.metrics.max_drawdown * 100).toFixed(2)}%`
              ) : (
                <span style={{ color: '#ccc' }}>--</span>
              ),
          },
          {
            title: '',
            dataIndex: ['metrics', 'drawdown_recovery_days'],
            render: (_, record) =>
              record.metrics ? (
                `${record.metrics.drawdown_recovery_days}`
              ) : (
                <span style={{ color: '#ccc' }}>--</span>
              ),
          },
          {
            title: '',
            valueType: 'option',
            render: (_, record) => [
              <a key="detail" onClick={() => history.push(`/products/${record.id}`)}>

              </a>,
              <a
                key="edit"
                onClick={async () => {
                  await loadInstitutions();
                  setEditing(record);
                  productForm.setFieldsValue({
                    name: record.name,
                    institution_id: record.institution_id,
                    product_code: record.product_code,
                    product_type: record.product_type,
                    risk_level: record.risk_level,
                    term_days: record.term_days,
                    liquidity_rule: record.liquidity_rule,
                    settle_days: record.settle_days,
                    note: record.note,
                  });
                  setEditOpen(true);
                }}
              >

              </a>,
              <Popconfirm
                key="delete"
                title=""
                description=""
                onConfirm={async () => {
                  try {
                    await deleteProduct(record.id);
                    message.success('');
                    actionRef.current?.reload();
                  } catch (e) {
                    console.error('Delete failed:', e);
                    message.error('');
                  }
                }}
              >
                <a style={{ color: 'red', marginLeft: 8 }}></a>
              </Popconfirm>,
            ],
          },
        ]}
      />

      <ModalForm<ProductFormValues>
        form={productForm}
        title=""
        open={createOpen}
        onOpenChange={(v) => setCreateOpen(v)}
        modalProps={{ destroyOnClose: true }}
        onFinish={async (values) => {
          try {
            const payload: CreateProductReq = {
              name: values.name,
              institution_id: values.institution_id ?? null,
              product_code: values.product_code ?? null,
              product_type: values.product_type,
              risk_level: values.risk_level ?? null,
              term_days: values.term_days ?? null,
              liquidity_rule: values.liquidity_rule,
              settle_days: values.settle_days,
              note: values.note ?? null,
            };
            await createProduct(payload);
            message.success('');
            actionRef.current?.reload();
            return true;
          } catch (e) {
            message.error('');
            return false;
          }
        }}
      >
        <ProFormText name="name" label="" rules={[{ required: true }]} />
        <ProFormSelect
          name="institution_id"
          label=""
          options={institutions.map((i) => ({ label: i.name, value: i.id }))}
          fieldProps={{
            allowClear: true,
            dropdownRender: (menu) => (
              <div>
                {menu}
                <div>
                  <Button
                    type="link"
                    onClick={() => {
                      institutionForm.resetFields();
                      setInstitutionCreateOpen(true);
                    }}
                  >

                  </Button>
                </div>
              </div>
            ),
          }}
        />
        <ProFormText name="product_code" label="" />
        <ProFormSelect
          name="product_type"
          label=""
          valueEnum={productTypeEnum}
          rules={[{ required: true }]}
        />
        <ProFormSelect
          name="risk_level"
          label=""
          allowClear
          options={['R1', 'R2', 'R3', 'R4', 'R5'].map((r) => ({ label: r, value: r }))}
        />
