import React, { useState, useEffect } from 'react';
import { useParams, history } from '@umijs/max';
import { PageContainer, ProCard, StatisticCard } from '@ant-design/pro-components';
import { Line } from '@ant-design/plots';
import { Radio, Descriptions, Tag, Alert, Empty, Button } from 'antd';
import { getProductMetrics, listProducts, Product, ProductMetrics } from '@/services/products';
import { getProductValuations, ProductValuation } from '@/services/valuations';
import dayjs from 'dayjs';

const ProductDetail: React.FC = () => {
  const params = useParams<{ id: string }>();
  const productId = Number(params.id);

  const [product, setProduct] = useState<Product | null>(null);
  const [metrics, setMetrics] = useState<ProductMetrics | null>(null);
  const [valuations, setValuations] = useState<ProductValuation[]>([]);
  const [loading, setLoading] = useState(false);
  const [window, setWindow] = useState('8w');
  const [metricsStatus, setMetricsStatus] = useState<string>('ok');

  // Define functions before use
  const loadProductInfo = async () => {
    const resp = await listProducts();
    const p = resp.items.find(i => i.id === productId);
    if (p) setProduct(p);
  };

  const loadData = async () => {
    setLoading(true);
    try {
      // 1. Metrics
      const mResp = await getProductMetrics(productId, window);
      setMetrics(mResp.metrics);
      setMetricsStatus(mResp.status);

      // 2. Valuations (for chart)
      let start = dayjs();
      if (window === '4w') start = start.subtract(4, 'week');
      else if (window === '8w') start = start.subtract(8, 'week');
      else if (window === '12w') start = start.subtract(12, 'week');
      else if (window === '24w') start = start.subtract(24, 'week');
      else if (window === '1y') start = start.subtract(1, 'year');
      else if (window === 'ytd') start = dayjs().startOf('year');

      const vResp = await getProductValuations(
          productId, 
          start.format('YYYY-MM-DD'), 
          dayjs().format('YYYY-MM-DD')
      );
      setValuations(vResp.points);

    } catch (e) {
      console.error(e);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    loadProductInfo();
  }, [productId]);

  useEffect(() => {
    if (productId) {
      loadData();
    }
  }, [productId, window]);

  const config = {
    data: valuations,
    xField: 'date',
    yField: 'market_value',
    point: {
      size: 2,
      shape: 'circle',
    },
    tooltip: {
        formatter: (datum: any) => {
            return { name: '', value: Number(datum.market_value).toFixed(4) };
        },
    },
    xAxis: {
        tickCount: 5,
    }
  };

  return (
    <PageContainer
      header={{
        title: product?.name || '',
        subTitle: product?.product_code,
        extra: [
            <Button key="back" onClick={() => history.back()}>

            </Button>,
            <Radio.Group key="window" value={window} onChange={e => setWindow(e.target.value)} buttonStyle="solid">
                <Radio.Button value="4w">1</Radio.Button>
                <Radio.Button value="8w">2</Radio.Button>
                <Radio.Button value="12w">3</Radio.Button>
                <Radio.Button value="24w"></Radio.Button>
                <Radio.Button value="1y">1</Radio.Button>
            </Radio.Group>
        ]
      }}
    >
      <ProCard direction="column" ghost gutter={[0, 16]}>

        {/*  */}
        <ProCard title="" bordered>
            <Descriptions column={3}>
                <Descriptions.Item label="">{product?.institution_id}</Descriptions.Item>
                <Descriptions.Item label=""><Tag>{product?.product_type}</Tag></Descriptions.Item>
                <Descriptions.Item label="">{product?.risk_level}</Descriptions.Item>
                <Descriptions.Item label="">{product?.liquidity_rule}</Descriptions.Item>
                <Descriptions.Item label="">{product?.term_days}</Descriptions.Item>
                <Descriptions.Item label="">T+{product?.settle_days}</Descriptions.Item>
            </Descriptions>
        </ProCard>

        {/*  */}
        <ProCard bordered loading={loading}>
            {metricsStatus === 'insufficient_data' ? (
                <Alert message=" 2 " type="warning" showIcon />
            ) : (
                <StatisticCard.Group>
                    <StatisticCard 
                        statistic={{ 
                            title: '', 
                            value: metrics?.annualized ? (metrics.annualized * 100).toFixed(2) : '--',
                            suffix: '%',
                            precision: 2
                        }} 
                    />
                    <StatisticCard 
                        statistic={{ 
                            title: '', 
                            value: metrics?.max_drawdown ? (metrics.max_drawdown * 100).toFixed(2) : '--',
                            suffix: '%',
                            precision: 2,
                            valueStyle: { color: 'green' }
                        }} 
                    />
                    <StatisticCard 
                        statistic={{ 
                            title: 'TWR ()', 
                            value: metrics?.twr ? (metrics.twr * 100).toFixed(2) : '--',
                            suffix: '%',
                            precision: 2
                        }} 
                    />
                    <StatisticCard 
                        statistic={{ 
                            title: '', 
                            value: metrics?.drawdown_recovery_days ?? '--',
                            suffix: ''
                        }} 
                    />
                </StatisticCard.Group>
            )}
        </ProCard>

        {/*  */}
        <ProCard title="" bordered loading={loading}>
            {valuations.length > 0 ? (
                <Line {...config} />
            ) : (
                <Empty description="" />
            )}
        </ProCard>

      </ProCard>
    </PageContainer>
  );
};

export default ProductDetail;
